import React from 'react'

function Squads() {
    const squad = [{
        team: "Chennai Super Kings",
        players: [{
            name: "Murali Vijay",
            role: "Batsman"
        },
        {
            name: "Dhoni",
            role: "Wicket Keeper"
        },
        {
            name: "Dwayne Bravo",
            role: "All Rounder"
        },
        {
            name: "Imran Tahir",
            role: "Bowler"
        }
        ]
    },
    {
        team: "Mumbai Indians",
        players: [{
            name: "Murali Vijay",
            role: "Batsman"
        },
        {
            name: "Dhoni",
            role: "Wicket Keeper"
        },
        {
            name: "Dwayne Bravo",
            role: "All Rounder"
        },
        {
            name: "Imran Tahir",
            role: "Bowler"
        }
        ]
    }]
    return (
        <div className="w3-container mt-3">
            {
                squad.map((data, index) => {
                    return (
                        <div key={index} className="mb-0">
                            <p className="mb-1">{data.team}</p>
                            <hr className="mb-2 mt-2 p-0" />
                            {
                                data.players.map((player, index) => {
                                    if (player.role === "Batsman") {
                                        return (
                                            <p className="w3-light-green">Batsman</p>
                                        )
                                    }

                                })
                            }
                        </div>
                    )
                })
            }
        </div>
    )
}

export default Squads
